import React from "react";
import "./app.css";

import StepperForm from "./component/bank/stepperForm";

function formatNumber(num) {
  return num.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ',');
}

console.log(formatNumber(1234567890)); // 1,234,567,890

function App() {
  return (
    <div className="App">
      <StepperForm />
    
    </div>
  );
}

export default App;
